// This is a layout design for all pages to have same theme/design
import React from 'react';
import Container from 'react-bootstrap/Container';
// Container obj from Bootstrap automatically configures borders of given props

const Layout = (props) => (
    <Container>
        {props.children}
    </Container>
)

export default Layout;
